    const[show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    return(
        <>

        <ModalDialog onMouseEnter={handleShow} onMouseLeave={handleClose} img = {img} text = {text} id={id}>

                hello
      
        </ModalDialog>


        </>
    )

}
